-- In a class definition a function definition without a type signature is not allowed
checkClassFunctions :: Names -> [(Name,TpScheme)] -> Errors
checkClassFunctions declVarNames ts =
    let signatures = map fst ts
    in [ NoTypeDefInClass Definition name signatures
       | name <- declVarNames
       , name `notElem` signatures
       ]
   {- ++ [ OverloadedRestrPat name
       | (name, scheme) <- xs
       , name `elem` unique
       , name `elem restrictedNames
       , isOverloaded scheme
       ] -}


-- Type signature but no function definition
-- Duplicated type signatures
-- Overloaded type scheme for a restricted pattern
checkTypeSignatures :: Names -> Names -> [(Name,TpScheme)] -> Errors
checkTypeSignatures declVarNames restrictedNames xs =
   let (unique, doubles) = uniqueAppearance (map fst xs)
   in [ Duplicated TypeSignature names
      | names <- doubles
      ]
   ++ [ NoFunDef TypeSignature name declVarNames
      | name <- unique
      , name `notElem` declVarNames
      ]
   ++ [ OverloadedRestrPat name
      | (name, scheme) <- xs
      , name `elem` unique
      , name `elem` restrictedNames
      , isOverloaded scheme
      ]



isSimplePattern :: Pattern -> Bool
isSimplePattern pattern =
   case pattern of
      Pattern_Variable _ _ -> True
      Pattern_Parenthesized  _ p -> isSimplePattern p
      _ -> False

--This function inspects whether a type is legal as type  for declaring an instance on
validInstanceType :: Type -> Bool
validInstanceType (Type_Constructor _ _) = True  -- A simple type is fine
validInstanceType (Type_Parenthesized _ t) = validInstanceType t -- Just look inside
validInstanceType (Type_Application _ _ ty tys) = (validApplyType ty tys) && (and $ map validInnerInstanceType tys) -- Some complicated stuff
validInstanceType _                      = False -- We don't like quantified and unbound types etc...

validInnerInstanceType :: Type -> Bool
validInnerInstanceType (Type_Parenthesized _ t) = validInnerInstanceType t
validInnerInstanceType (Type_Variable _ _) = True
validInnerInstanceType _                   = False

validApplyType :: Type -> Types -> Bool
validApplyType (Type_Constructor _ n) ts = validInstanceConstrName n ts
validApplyType _                      _  =  False

validInstanceConstrName :: Name -> Types -> Bool
validInstanceConstrName (Name_Special _ _ _ s) ts = s == "(" ++ replicate (length ts - 1) ',' ++ ")" || s == "[]"
    --We just want to know if it was a tuple
validInstanceConstrName (Name_Identifier _ _ _ _) _ = True
validInstanceConstrName _ _ = False

-- All type variables in an instance declaration have to be unique

nonUniqueTypeVars :: Names -> Names
nonUniqueTypeVars (x:xs) | elem x xs = x : nonUniqueTypeVars xs
                         | otherwise = nonUniqueTypeVars xs
nonUniqueTypeVars []     = []

classExists :: Name -> ClassMemberEnvironment -> (Maybe ClassDef)
classExists n cm = case (M.lookup n cm) of
                    (Just m) -> Just (n, m)
                    Nothing  -> Nothing

instanceMembers :: ImportEnvironment -> MaybeDeclarations -> ClassDef -> Errors
instanceMembers _ MaybeDeclarations_Nothing _ = []
instanceMembers nenv (MaybeDeclarations_Just decls) d = instanceMembers' nenv decls d
  -- where n = concatMap nameOfDeclaration decls

instanceMembers' :: ImportEnvironment -> Declarations -> ClassDef -> Errors
instanceMembers' nenv (d:ds) c@(n, members) = let fn = head $ nameOfDeclaration d
                                                  cm = map (\(x, _, _, _) -> x) (snd members)
                                          in
                                             case elem fn cm of
                                              True -> instanceMembers' nenv ds c
                                              False -> UndefinedFunctionForClass (unQualifyName nenv n) fn cm : instanceMembers' nenv ds c
instanceMembers' _ []     _       = []

--Check all instance declarations, check if their superclass relations hold, return those predicates that fail to check.
checkClassEnvironment :: OrderedTypeSynonyms -> ClassEnvironment -> [(Range, Instance)] -> [(Range, Predicate, Predicates)]
checkClassEnvironment env cEnv allInstances = map (\(r, (i, ctxt)) -> let
                                                                     proves = bySuperclass cEnv i
                                                                     classEnv = foldr insertInst cEnv allInstances
                                                                     in (r, i, filter  (\p -> not $ (entail env classEnv ctxt p)) proves)) allInstances

insertInst :: (t, (Predicate, Predicates)) -> ClassEnvironment -> ClassEnvironment
insertInst (_, inst@((Predicate n _), _)) env = insertInstance n inst env

makeClassEnvironmentErrors :: ImportEnvironment -> [(Range, Predicate, Predicates)] -> Errors
makeClassEnvironmentErrors env ((r, c, pr):insts) | pr == []  = makeClassEnvironmentErrors env insts
                                                   | otherwise = foldr (\p -> (:)(MissingSuperClass r (unqualifier c) (unqualifier p))) (makeClassEnvironmentErrors env insts) pr
  where unqualifier = convertPredicate (unQualifyName env)
makeClassEnvironmentErrors _ []                                = []


overlappingInstances :: ClassNameEnvironment -> ClassEnvironment -> Errors
overlappingInstances env = M.foldrWithKey (\k (_, i) b -> (overlappingInstances' k i) ++ b) []
   where
    overlappingInstances' :: String -> Instances -> Errors
    overlappingInstances' name insts = [OverlappingInstance (getNameName $ unQualifyClassName env (nameFromString name)) ty |
                            ty <- map head $ filter (\l -> length l > 1) $ group . sort $ map ((\(Predicate _ ty) -> fst $ leftSpine ty) . fst) insts]

noTypeSynonymsInInstance :: OrderedTypeSynonyms -> [(Range, Instance)] -> Errors
noTypeSynonymsInInstance typeSyn ((r, (p, _)):insts)  = if (typeSynonymInPredicate typeSyn p)
                                                         then (TypeSynonymInInstance r p) : (noTypeSynonymsInInstance typeSyn insts)
                                                         else noTypeSynonymsInInstance typeSyn insts
noTypeSynonymsInInstance _      []                    = []

typeSynonymInPredicate :: OrderedTypeSynonyms -> Predicate -> Bool
typeSynonymInPredicate typeSyn (Predicate _ ty) = case (expandToplevelTC typeSyn ty) of
                                                    Nothing -> False
                                                    _       -> True
deleteClassErrors :: Errors -> Errors
deleteClassErrors errs = filter p errs where
    p (NoFunDef TypeSignature _ _)  = False
    p _                             = True


   


findSimilarFunctionBindings :: [(Name, TpScheme)] -> [(Name,Name)] -> [Warning]
findSimilarFunctionBindings environment candidates =
   let namesWithTypeDef = map fst environment
   in [ uncurry SimilarFunctionBindings pair
      | (n1,n2) <- candidates
      , let bool1 = n1 `elem` namesWithTypeDef
            bool2 = n2 `elem` namesWithTypeDef
            pair  = if bool1 then (n2,n1) else (n1,n2)
      , bool1 `xor` bool2
      ]

xor :: Bool -> Bool -> Bool
xor b1 b2 = not (b1 == b2)


simplifyContext :: OrderedTypeSynonyms -> Range -> [(Int, Name)] -> TpScheme -> ImportEnvironment -> Warnings
simplifyContext synonyms range intMap typescheme importEnv =
   let qualScheme = convertTpSchemeToQualified importEnv typescheme
       predicates = qualifiers (unquantify qualScheme)
       reduced    = f predicates []
          where f [] as = reverse as -- reverse to original order
                f (p:ps) as
                   | entail synonyms (classEnvironment importEnv) (ps++as) p = f ps as
                   | otherwise = f ps (p:as)
       sub = listToSubstitution [ (i, TCon (show n)) | (i, n) <- intMap ]
       unQualPred = map (convertPredicate removeQualified)
   in if length reduced == length predicates
        then []
        else [ ReduceContext range (unQualPred $ sub |-> predicates) (unQualPred $ sub |-> reduced) ]



noInstanceOrDefault :: Name -> Names -> Maybe ClassDef -> MaybeDeclarations -> Names
noInstanceOrDefault _ _ Nothing             _                               = []
noInstanceOrDefault _ _ (Just (_, members)) MaybeDeclarations_Nothing       = 
                                                            [ n 
                                                            | (n, _, d, False) <- snd members
                                                            , not d
                                                           
                                                            ]
noInstanceOrDefault _ _ (Just (_, members)) (MaybeDeclarations_Just decls)  = 
                                                            [ n 
                                                            | (n, _, d, False) <- snd members
                                                            , not d
                                                            , notElem n (map (head . nameOfDeclaration) decls)
                                                            ]

deleteClassWarnings :: Warnings -> Warnings
deleteClassWarnings warnings = filter p warnings where
    p (Unused _ _)                  = False
    p _                             = True



checkType :: M.Map Name (Int, Name) -> [Names] -> Names -> Type -> [Error]
checkType theTypeConstructors ambiguousTypeCon namesInScope t =
    let (f, xs) = walkSpine t
        xsErrors = concatMap (checkType theTypeConstructors ambiguousTypeCon namesInScope) xs
    in
        xsErrors
        ++
        case f of
            Type_Constructor r c ->
                checkKind c theTypeConstructors ambiguousTypeCon (length xs) namesInScope
                ++ [ TupleTooBig r
                   | let nameAsString = show c
                   , isTupleConstructor nameAsString
                   , length nameAsString - 1 > 10
                   ]
            Type_Variable _ v -> []
            _ ->
                internalError "StaticAnalysis" "checkType" "unexpected type"

walkSpine :: Type -> (Type, [Type])
walkSpine t =
    case t of
        Type_Variable _ _ -> (t, [])
        Type_Constructor _ _ -> (t, [])
        Type_Application _ _ f xs ->
            let (t', ys) = walkSpine f
            in (t', ys ++ xs)
        Type_Parenthesized _ t' -> walkSpine t'
        Type_Qualified _ _ t' -> walkSpine t'
        _ -> internalError "StaticAnalysis" "walkSpine" "unexpected type"

checkKind :: Name -> M.Map Name (Int, Name) -> [Names] -> Int -> Names -> [Error]
checkKind tycon@(Name_Special _ _ _ ('(':commas)) _ _ useArity _ = -- !!!Name
    if expected == useArity then
        []
    else
        [ ArityMismatch TypeConstructor tycon expected useArity]
    where
        expected =
            case length (takeWhile (== ',') commas) of
                 0 -> 0  -- ()
                 n -> n + 1 -- (,) (,,) ...

checkKind tycon theTypeConstructors ambiguousTypeCon useArity namesInScope =
    case M.lookup tycon theTypeConstructors of
        Nothing -> let hint = [ "Constructor "++show (show tycon)++" cannot be used in a type"
                                | tycon `elem` namesInScope]
                        in ambiguousOrUndefinedErrors TypeConstructor tycon (M.keys theTypeConstructors) ambiguousTypeCon hint
        Just (defArity,_) ->
            if useArity /= defArity then
                [ ArityMismatch TypeConstructor tycon defArity useArity ]
            else
                [ ]

                  
type ScopeInfo = ( [Names]          -- duplicated variables
                 , [Name]           -- unused variables
                 , [(Name, Name)]   -- shadowed variables
                 )

changeOfScope :: Names -> Names -> Names -> (Names, Names, ScopeInfo)
changeOfScope names unboundNames namesInScope = 
   let (uniqueNames, duplicatedNames) = uniqueAppearance names
       unusedNames   = uniqueNames \\ unboundNames
       shadowedNames = let f n = [ (n, n') | n' <- namesInScope, n == n' ]
                       in concatMap f uniqueNames
   in ( uniqueNames ++ map head duplicatedNames ++ (namesInScope \\ names)
      , unboundNames \\ names
      , (duplicatedNames, unusedNames, shadowedNames)
      )
      
uniqueAppearance :: Ord a => [a] -> ([a],[[a]])
uniqueAppearance = Prelude.foldr myInsert ([],[]) . group . sort
   where myInsert [x] (as,bs) = (x:as,bs)
         myInsert xs  (as,bs) = (as,xs:bs)

mergeSameOriginName :: [Name] -> [Name]
mergeSameOriginName = map head
                   . groupBy eq 
                   . sortBy comp
    where
        comp x y = case compare x y of
            EQ -> compare (getNameOrigin x) (getNameOrigin y)
            cp -> cp
        eq   x y = x == y && (getNameOrigin x) == (getNameOrigin y)
       
nextUnique :: Num a => a -> (a, a)         
nextUnique n = (n+1, n)

includeQualifiedName :: [String] -> Name -> [Name]
includeQualifiedName qual n = addQualified qual n : [n]

getClassMemberNames :: Name -> M.Map Name (Names, [(Name, TpScheme, Bool, HasDefault)]) -> [Name]
getClassMemberNames name env =  let err = internalError "Scope.ag" "getClassMemberNames" $ "Unknown class in environment: " ++ show name
                                in maybe err (map (\(fn, _, _, _) -> fn) . snd) (M.lookup name env)


addQualifiedCollect :: [String] -> Name -> a -> [(Name, a)] -> [(Name, a)]
addQualifiedCollect qual name result collect =
    let qualname = addQualified qual name
        res1 = (name, result)
        res2 = (qualname, result)
    in res1 : res2 : collect



filterQualifiedDoubles :: ([(Name,a)],[[Name]]) -> ([(Name,a)],[[Name]]) 
filterQualifiedDoubles (orig, doubles) = (orig, filter (not . isQualified . head) doubles)

uniqueKeys :: Ord key => [(key,a)] -> ([(key,a)],[[key]])
uniqueKeys = let comp (x,_) (y,_) = compare x y
                 eq   (x,_) (y,_) = x == y
                 predicate xs = length xs == 1
             in (\(xs, ys) -> (map head xs, map (map fst) ys))
              . partition predicate
              . groupBy eq
              . sortBy comp

uniqueKeysWithValue :: Ord key => [(key,a)] -> ([(key,a)],[[(key,a)]])
uniqueKeysWithValue = let comp (x,_) (y,_) = compare x y
                          eq   (x,_) (y,_) = x == y
                          predicate xs = length xs == 1 
                      in (\(xs, ys) -> (map head xs, ys)) 
                       . partition predicate 
                       . groupBy eq 
                       . sortBy comp

mergeSameOrigins :: [(Name,a)] -> [(Name,a)]
mergeSameOrigins = map head
                   . groupBy eq 
                   . sortBy comp
    where
        comp (x,_) (y,_) = case compare x y of
            EQ -> compare (getNameOrigin x) (getNameOrigin y)
            cp -> cp
        eq   (x,_) (y,_) = x == y && (getNameOrigin x) == (getNameOrigin y)




-- The following haskell code is used for building a temporary dictionairy in order to complete static checks
type ClassDef = (Name, ClassMembers)
type ClassMembers = (Names, [(Name, TpScheme, Bool, HasDefault)])
type ClassMembers' = [(Name, TpScheme, Bool, HasDefault)]

--In declarations we find both type signatures and function declarations
filterType :: Declarations -> (Declarations, Declarations) -> (Declarations, Declarations)
filterType (d@(Declaration_TypeSignature _ _ _):ds) (t, dec) = filterType ds (d:t, dec)
filterType (d:ds) (t, dec)                                   = filterType ds (t, d:dec)
filterType []     res                                        = res

--A type can be declared for multiple function names
createClassDef1 :: Declaration -> ClassMembers'
createClassDef1 (Declaration_TypeSignature _ names ty) = [(n, fst $ makeTpSchemeFromType' ty, False, False) | n <- names]
createClassDef1 _                                     = error "Error createClassDef1, filtering failed..."

--A function declaration should be associated with a type in the class definition
createClassDef2 :: Declarations -> ClassMembers' -> ClassMembers'
createClassDef2 (d:ds) m = createClassDef2 ds $ createClassDef2' (nameOfDeclaration d) d m
createClassDef2 []     m = m

createClassDef2' :: Eq t1 => [t1] -> t -> [(t1, TpScheme, Bool, HasDefault)] -> [(t1, TpScheme, Bool, HasDefault)]
createClassDef2' (n:ns) d m = createClassDef2' ns d $ createClassDef2'' n d m
createClassDef2' []     _ m = m


createClassDef2'' :: Eq t1 => t1 -> t -> [(t1, TpScheme, Bool, HasDefault)] -> [(t1, TpScheme, Bool, HasDefault)]
createClassDef2'' n d (m@(n2,t, _, def):ms) | n == n2   = (n2, t, True, def):ms
                                     | otherwise = m:(createClassDef2'' n d ms)
createClassDef2'' _ _ []                             = [] -- Should not happen but if it happens the error is reported by another check

createClassDef :: Name -> MaybeDeclarations -> Names -> ClassMemberEnvironment
createClassDef n MaybeDeclarations_Nothing names  = M.singleton n (names, [])
createClassDef n (MaybeDeclarations_Just decls) names = M.singleton n (names, createClassDef2 fdecl $ concatMap createClassDef1 types)
               where (types, fdecl) = filterType decls ([], [])

convertClassMemberEnvironmentTypes :: (TpScheme -> TpScheme) -> ClassMemberEnvironment -> ClassMemberEnvironment
convertClassMemberEnvironmentTypes f = fmap $ fmap $ fmap (\(a,b,c,d) -> (a,f b,c,d))

insertDefaults :: Name -> Names -> ClassMemberEnvironment -> ClassMemberEnvironment
insertDefaults name defs env = M.mapWithKey (\n membs -> if n == name then (update defs membs) else membs) env 
      where
          update :: Names -> (Names, [(Name, TpScheme, Bool, HasDefault)]) -> (Names, [(Name, TpScheme, Bool, HasDefault)])
          update locDefs (tvars, funcs) = (tvars, map (\(fname, tpscheme, b, _)->(fname, tpscheme, b, fname `elem` locDefs)) funcs)

insertInstances :: [(String, Tp, [(String, Tp)])] -> ClassEnvironment -> ClassEnvironment
insertInstances theInstances classEnv = foldr (\inst@(n, _, _) -> M.update (locInsert inst) n) classEnv theInstances
    where
        locInsert :: (String, Tp, [(String, Tp)]) -> Class -> Maybe Class
        locInsert (className, instType, preds) (cn, locInstances) = 
            let 
               curInstance = (Predicate className instType, [Predicate n v | (n, v) <- preds]) 
            in Just (cn, nub $ curInstance : locInstances)

insertClassMembers :: M.Map Name (Names, [(Name, TpScheme, Bool, HasDefault)]) -> M.Map Name TpScheme -> M.Map Name TpScheme
insertClassMembers classMemberEnv valueEnv = M.foldrWithKey locInsert valueEnv classMemberEnv
    where 
        locInsert :: Name -> (Names, [(Name, TpScheme, Bool, HasDefault)]) -> M.Map Name TpScheme -> M.Map Name TpScheme
        locInsert className (typeVars, funcs) env = foldr (insertFunc className typeVars)  env funcs
        insertFunc :: Name -> Names -> (Name, TpScheme, Bool, HasDefault) -> M.Map Name TpScheme -> M.Map Name TpScheme
        insertFunc className typeVars (name, tp, _, _) env = 
            let 
                typeIndices :: [(Int, String)]
                typeIndices = filter (\(_, s) -> s `elem` (map getNameName typeVars)) (getQuantorMap tp)
                typeVariablesMapped = map (\(n, s) -> (fromJust $ find (\tv -> getNameName tv == s) typeVars, TVar n)) typeIndices
                tpWContext = addContextToType className typeVariablesMapped tp
            in M.insert name tpWContext env



getTypeOfInstanceFunction :: Name -> Name -> ClassMemberEnvironment -> TpScheme
getTypeOfInstanceFunction instanceName name env = case M.lookup instanceName env of
        Just c ->   let (_, functions) = c
                        (_, tp, _, _) = fromMaybe (error "Unknown function in instance") (lookupFunc name functions)
                    in tp
        Nothing -> error "Unknown class in instance declaration"
    where
        lookupFunc :: Name -> [(Name, a, b, c)] -> Maybe (Name, a, b, c)
        lookupFunc _ [] = Nothing
        lookupFunc n (f@(nf, _, _, _):fs)  | n == nf   = Just f
                                        | otherwise = lookupFunc n fs

getSuperClasses ::  ContextItems -> [(Name, [TpScheme])]
getSuperClasses = map (\(ContextItem_ContextItem _ n vs) -> (n, map makeTpSchemeFromType vs))

getInstanceFunctionNames :: MaybeDeclarations -> [Name]
getInstanceFunctionNames (MaybeDeclarations_Nothing) = []
getInstanceFunctionNames (MaybeDeclarations_Just ds) = fmap (\d -> getDeclarationName d) ds

getDeclarationName :: Declaration -> Name
getDeclarationName (Declaration_FunctionBindings _ []) = error "No function bindings found" 
getDeclarationName (Declaration_FunctionBindings _ [fb]) = getFunctionBindingName fb
getDeclarationName (Declaration_FunctionBindings _ fb) =
        let names = map getFunctionBindingName fb 
            valid = all (==(head names)) names
        in if valid then head names else error "Inconsistent names in function bindings"
getDeclarationName _ = error "Unknown declaration in instance"

getFunctionBindingName :: FunctionBinding -> Name
getFunctionBindingName (FunctionBinding_FunctionBinding _ lhs _)= getLhsName lhs
getFunctionBindingName _ = error "No function binding in getFunctionBindingName"

getLhsName :: LeftHandSide -> Name
getLhsName (LeftHandSide_Function _ name _) = name
getLhsName (LeftHandSide_Infix _ _ name _) = name
getLhsName _ = error "Uncovered argument case in getLhsName"



createInstance :: Range -> Name -> Type -> ContextItems -> (Range, Instance)
createInstance r n ty ctx = (r, (makePredicate n ty , map (\(ContextItem_ContextItem _ n2 tys) -> makePredicate n2 (head tys)) ctx))
   where nameMap = makeNameMap (namesInTypes $ ty : (map (\(ContextItem_ContextItem _ _ tys) -> head tys) ctx))
         makePredicate :: Name -> Type -> Predicate
         makePredicate nm typ = Predicate (getNameName nm) (makeTpFromType nameMap typ)



-- filter undefined errors that are caused by the removal of a duplicate definition
filterRemovedNames :: [(Name,Entity)] -> Error -> Bool
filterRemovedNames list err = 
   case err of  
      Undefined entity name _ _ -> (name,entity) `notElem` list
      _                         -> True
      
filterDerivedNames :: [Range] -> Error -> Bool
filterDerivedNames ranges err = 
   case err of
      Duplicated Definition names -> any (`notElem` ranges) (map getNameRange names) 
      _                           -> True
