wrap_Alternative !(T_Alternative act) !(Inh_Alternative _lhsIallTypeConstructors _lhsIallValueConstructors _lhsIambiguousConflicts _lhsIambiguousTypeConstructors _lhsIambiguousValueConstructors _lhsIclassEnvironment _lhsIclassMemberEnv _lhsIclassNamesEnv _lhsIcollectScopeInfos _lhsIcounter _lhsIimportEnvironments _lhsIkindErrors _lhsImiscerrors _lhsInamesInScope _lhsIoptions _lhsIorderedTypeSynonyms _lhsIqualifiedEnvironment _lhsItypeConstructors _lhsItypeConstructorsWithDefined _lhsIvalueConstructors _lhsIwarnings) =
