     do !sem <- act
        let arg1 = T_Alternative_vIn1 _lhsIallTypeConstructors _lhsIallValueConstructors _lhsIambiguousConflicts _lhsIambiguousTypeConstructors _lhsIambiguousValueConstructors _lhsIclassEnvironment _lhsIclassMemberEnv _lhsIclassNamesEnv _lhsIcollectScopeInfos _lhsIcounter _lhsIimportEnvironments _lhsIkindErrors _lhsImiscerrors _lhsInamesInScope _lhsIoptions _lhsIorderedTypeSynonyms _lhsIqualifiedEnvironment _lhsItypeConstructors _lhsItypeConstructorsWithDefined _lhsIvalueConstructors _lhsIwarnings
